<!DOCTYPE html>
<html>
<head>
 <title>Finding the logs</title>
 <style>
   div.customanchor {margin-top:-60px ; padding-top:60px}
 </style>
</head>
<body>
<xmp id="README" theme="united" style="display:none;"></xmp>

<!-- load .md -->
<script type="text/javascript">
var req = new XMLHttpRequest();
req.onload = function() {
var xmpNode = document.getElementById('README');
xmpNode.appendChild(document.createTextNode(this.responseText));
}
req.open('GET', 'Finding_logs.md', false);
req.send();
</script>

<!-- "interact with user if JS is disabled -->
<noscript>
Javascript disabled. Raw markdown documentation: <a href="Finding_logs.md">Finding_logs.md</a>
</noscript>

<!-- load shit -->
<script src="http://ndossougbe.github.io/strapdown/dist/strapdown.js"></script>
</body>
</html>
